import React, { Component } from "react";
import {
  Container,
  Col,
  Form,
  FormGroup,
  FormText,
  FormFeedback,
  Label,
  Input,
  Button
} from "reactstrap";
import { Link } from "react-router-dom";

export default class Home extends Component {
  render() {
    return (
      <Container>
        {" "}
        <Col xs="6">
          <Button tag={Link} to="/login" id="signin" color="success" size="lg">
            Login
          </Button>
        </Col>
        <Col xs="6">
          <Button
            id="register"
            tag={Link}
            color="warning"
            size="lg"
            to="/register"
          >
            Register
          </Button>
        </Col>
      </Container>
    );
  }
}
